//import './App.css';
import React from "react";
import { TodoCounter } from'./TodoCounter';
import { CreateTodoButtom } from './CreateTodoButtom';
import { TodoSearch } from './TodoSearch';
import { TodoList } from './TodoList';
import { TodoItem } from './TodoItem';

const todos =  [
  {text: 'Cortar Cebolla',
  completed: false},
  {text: 'Hacer Curso De React',
  completed: false},
  {text: 'Llorar con la Llorona',
  completed: false}
]
function App() {
  return (
<React.Fragment>
   <TodoCounter />
   <TodoSearch />
   <CreateTodoButtom />


   <TodoList>
   {todos.map(todo=>(
   <TodoItem keytext={todo.text}/>
     ))}
    {<TodoItem />}
    </TodoList>


    </React.Fragment>
  );
}

export default App;
